Problem: Right now, both dictionaries and records are represented by a DObj and a TObj. We need to separate them. Subproblem: the only way to update a "record" is with Dict::set. Solution : add a syntax for updating records. In existing functional languages, they use { existingValue with fieldName1 = newValue1; fieldName2 = newValue2 } Status: not speced Subproblem: The "syntax" to create dicts and records is overloaded. Both use { field : value } (as both are the same thing right now. If we split them, we need a way to disambiguate which one you're creating. Solution option 1: Add a new syntax for records. For example, we might do: Person {. The big advantage here is that the autocomplete would create a bunch of new fields to fill in the object, like so: Person { name : ___ // "string" placeholder text) age : ___ // "int" placeholder text
} Solution option 2: Add a new syntax for dictionaries. For example, we might do: let myDict = dict{ ___ : ___ // would be useful to have a prompt to tell you to use quotes here
} This would have a number of other benefits Subproblem: What do we do with existing records and objects? Do they become records or objects or a third legacy DObj? Solutions: Add a new dictionary type, that is not compatible with DObj It would need new functions that are type compatible It would allow keys of any single type The values would homogenous dot syntax would not be supported (use Dict::get instead) record syntax would not be supported could support dot Remove hack where we allow hyphens in record names Since people use maps for headers, switch headers to string pairs Add a type checker which distinguishes between Dicts and Record DObj would become just a record old Dict:: functions would be for records, and would be deprecated. They could even be renamed to Record:: for now, until we add syntax for the new stuff. We could automatically transition them to the new stuff dot access could instead be Status: TODO
